import React from "react";
import "./Home.css";
import ThisWeek from "../components/Homepage/ThisWeek";

const Home: React.FC = () => {
  const completedDays = ["Sun", "Mon", "Tue", "Thu"]; // External array of completed days

  return (
    <div className="App">
      <ThisWeek completedDays={completedDays} />
    </div>
  );
};

export default Home;
